import java.util.*;

//根据字符出现频率排序
public class Solution451 {
    public static void main(String[] args) {
        StringBuilder stringBuilder = new StringBuilder("\"");
        System.out.println(new Solution451().frequencySort(stringBuilder.toString()));
    }

    private class Freq {
        char c;
        Long freq;

        public Freq(char c, Long freq) {
            this.c = c;
            this.freq = freq;
        }
    }

    public String frequencySort(String s1) {
        StringBuilder stringBuilder = new StringBuilder(s1);
        TreeMap<Character, Long> treeMap = new TreeMap<>();
        for (int i = 0; i < stringBuilder.length(); i++) {
            if (treeMap.containsKey(stringBuilder.charAt(i))) {
                treeMap.put(stringBuilder.charAt(i), treeMap.get(stringBuilder.charAt(i)) + 1);
            } else {
                treeMap.put(stringBuilder.charAt(i), (long) 1);
            }
        }
        PriorityQueue<Freq> priorityQueue = new PriorityQueue<>(new Comparator<Freq>() {
            @Override
            public int compare(Freq a, Freq b) {
                if (a.freq < b.freq) {
                    return 1;
                } else if (a.freq > b.freq) {
                    return -1;
                } else {
                    return a.c - b.c;
                }
            }
        });
        for (Character character : treeMap.keySet()) {
            priorityQueue.add(new Freq(character, treeMap.get(character)));
        }
        StringBuilder result = new StringBuilder();
        while (!priorityQueue.isEmpty()) {
            StringBuilder cur = new StringBuilder();
            Freq freq = priorityQueue.poll();
            for (int i = 0; i < freq.freq; i++) {
                cur.append(freq.c);
            }
            result.append(cur);

        }

        return result.toString();
    }
}
